    @Test
    public void testGetCenterLine() {
        for (int i = 0; i < expected.size(); i++) {
            Geometry centerLine = CenterLine.getCenterLine(inputs.get(i));

            assertTrue("equalsNorm:" + i, expected.get(i).equalsNorm(centerLine));
        }
    }

    @Test
    public void testGetSkeleton() {
        for (int i = 0; i < expected.size(); i++) {
            Geometry skeleton = Skeletonize.getSkeleton(inputs.get(i));

            assertTrue("expectedSkel:" + i, expectedSkel.get(i).equalsNorm(skeleton));
        }
    }
